import React from 'react';

const DeliveryOptions = () => {
  return (
    <div className="delivery-options">
      <h2>Способы доставки</h2>
      <ul>
        <li>Доставка на дом</li>
        <li>Самовывоз</li>
      </ul>
    </div>
  );
};

export default DeliveryOptions;
